import React, { useState, useEffect } from 'react';

function PlayerInfo() {
  const [players, setPlayers] = useState([]);

  useEffect(() => {
    fetch("https://api.adviceslip.com/advice")
    .then(resp=> resp.json())
    .then(data => setPlayers(data))
    
    
  },[]) 
  return (
    <div>{players[0]}</div>
  )
}
export default PlayerInfo;
